								res = yield("", "")
								idx = (sz + 1)
							end
						else
							res = yield(line_nr, idx)
						end
					end
				end

				handle_requests(first_arg)
				line_nr = 1

				while (true) do

					if (idx > sz) then
						while (true) do
							handle_requests(yield())
						end
					end

					for i = 1,num_lua_matches do
						local m = lua_matches[i]
						local pat = m[1]
						local fun = m[2]
						local findres = {strfind(s, pat, idx)}
